import React from 'react';
import logo from './logo.svg';
import './App.css';

function Header() {
  return (
    <div className="bg-sky-500 h-11 flex items-center p-4">
      <h1 className="ttest-slate-900 font-extrabold text-4xl sm:text-2xl">Workify</h1>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header></Header>

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className='mb-3'>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
